/** @format */

import React from "react";
import Button from "@material-ui/core/Button";
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";
const Comman = (props) => {
  return (
    <>
      <Navbar />
      <div className="container commanBody">
        <div className="row">
          <div className="col-md-6 tag">
            <h1>Grow your business with UsmanKhalid</h1>
            <p>We are the team of talented developer making websites</p>
            <Button>Get Started</Button>
          </div>
          <div className="col-md-6 Fimg">
            <img
              src="https://thapatechnical.github.io/reactlivewebsite/static/media/img2.e981619f.svg"
              alt="img"
            />
          </div>
        </div>
      </div>
      <Footer />
    </>
  );
};
export default Comman;
